impl Solution {
    pub fn beautiful_substrings(s: String, k: i32) -> i32 {
        let bytes = s.as_bytes();
        let mut result = 0;
        let mut prefix_sum = vec![(0, 0); s.len() + 1]; // (vowels, consonants)

        for i in 0..s.len() {
            let is_vowel = matches!(bytes[i], b'a' | b'e' | b'i' | b'o' | b'u');
            prefix_sum[i + 1] = if is_vowel {
                (prefix_sum[i].0 + 1, prefix_sum[i].1)
            } else {
                (prefix_sum[i].0, prefix_sum[i].1 + 1)
            };
        }

        for i in 0..s.len() {
            for j in (i + 1)..=s.len() {
                let (vowels, consonants) = (prefix_sum[j].0 - prefix_sum[i].0, prefix_sum[j].1 - prefix_sum[i].1);
                if vowels == consonants && (vowels * consonants) % k == 0 {
                    result += 1;
                }
            }
        }

        result
    }
}
